import { View, Image, Text } from "react-native";

import s from "./styles";

const GameCardLava = ({ uri, title }) => {
  return (
    <View style={s.card}>
      <Image style={s.logo} source={{ uri }} />
      <Text style={s.title} numberOfLines={2}>
        {title}
      </Text>
    </View>
  );
};

export default GameCardLava;
